import React from 'react'

const ExternalServices = () => {
    return (
        <>
        {ServicesList.map(({name, icon}) => (
        <div className={"external-account"}><a href={"https://www.google.com"}>{name}<img src={""}/></a></div>))}
        
        </>
    )
}
const ServicesList = [
    {
    name: "google",
    adress: "https://www.google.com",
    icon: "../images/icons/external1Google.png"
    },
    {
    name: "facebook",
    adress: "https://www.facebook.com",
    icon: "../images/icons/external1Google.png"
    },
]

export default ExternalServices
